import React from 'react'
import {Card,Avartar} from 'antd'

const UserProfile =() =>{
    return (
   <Card>
       <Card.Meta
       avatar={<Avartar>Su</Avartar>} 
        title="Su"
       />
   </Card>
    )
}

export default UserProfile;
